import React from "react";

function Error404() {
  const style = {
    backgroundColor: "black",
    // background: "transparent",
    color: "white",

    fontSize: "3rem",
    // textAlign: "center",
    width: "100%",
    padding: "1rem",
  };
  return (
    <div class="wrapper">
      <h1 style={style}>Page not found</h1>;
    </div>
  );
}

export default Error404;
